export default {
  data() {
    return {
      show: true,
      dialogVisible: false,
      form: {
        name: '',
        number: '',
        time: '',
        leibie: '',
        textarea: '', 
        jianchayuan: '',
        lvshi: '',
      },  
    }
  },
  created() {},
  mounted() {},
  methods: {
    beginJf() {
      for(var k in this.form) {
        if (this.form[k] == '') {
          this.$message.error('请输入完整信息')
          return false
        }
      }
      this.$api.getwlhuajieadd(this.form).then(res => {
        this.$message.success('提交成功')
      })
    },
    goback() {
      this.$router.go(-1)
    }
  }
}
